(992, 207, 'about_us_content', 'Ремонт грузовых автомобилей это основа деятельности компании <strong>\"БелТракЦентр\"</strong>. Наша компетенция - это ремонт грузовых автомобилей европроизводителей. Компания <strong>\"БелТракЦентр\"</strong> предлагает диагностику и комплексный ремонт грузовых автомобилей в Минске более полутора десятков лет.<img class=\"size-full wp-image-206 alignright\" src=\"http://bts.loc/wp-content/uploads/2020/04/image-21.png\" alt=\"\" width=\"284\" height=\"277\" />\r\n\r\nМатериальная база нашего СТО предоставляет возможность высококачественно и без промедлений выполнить любой, даже самый сложный ремонт грузового автомобиля. Опытность сотрудников позволяет гарантировать качество оказываемых услуг по ремонту грузовых автомобилей.\r\n<h3>Грузовое СТО ООО\"БелТракЦентр\"</h3>\r\nГрузовой автосервис <strong>ООО \"БелТракЦентр\"</strong> зарекомендовал себя как сервис грузовиков с грамотным, профессиональным и ответственным подходом к работе.\r\nУ нас собственная станция технического обслуживания, в наличии все необходимое оборудование для оперативного и качественного ремонта грузовиков.\r\n\r\nСтрогий подбор компетентных специалистов, постоянные стажировки и обучение позволяют выполнять ремонт грузовых автомобилей в Минске на высоком уровне и с гарантией на все виды работ.\r\n<h3>Сервис грузовиков</h3>\r\nМы советуем вам обращеться к нам <em>с проблемами любой сложности</em>. Мы проводим контрольно-диагностический анализ всех систем автомобиля, что позволяет выявить неисправность любых узлов грузовика и устранить поломку в максимально краткие сроки.\r\nГибкая ценовая политика, широкий спектор услуг дают возможность удовлетворить потребности каждого нашего клиента.'),
