INSERT INTO `wp_postmeta` (`meta_id`, `post_id`, `meta_key`, `meta_value`) VALUES
(1294, 64, 'callbacks_list_0_content', '<!--(figmeta)eyJmaWxlS2V5IjoiNnhBdnVoaWxKR1lWMHdQNG1xMURPbyIsInBhc3RlSUQiOjIwMTAyODY5NzMsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)--><!--(figma)(/figma)-->В нашем автопарке более 15 грузовых авто, каждое из которых должно быть на ходу, поэтому выбор СТО для нас важен. Техпроект са нам попался после сотрудничества с тремя другими автосервисами. И проведя здесь свое первое ТО семь лет назад, поняли, что больше можно не искать. Из достоинств сервиса отмечу удобное расположение, принимают оплату безнал, не гнут цену, а качество обслуживания хорошее, ремонтируют все по-честному. Работают ребята без выходных, и в любой момент у них можно решить вопросы по ремонту.\r\n\r\nСейчас, как у постоянных клиентов, у нас есть скидка на ремонт, поэтому автосервис БелТракЦентр са не променяем на любой другой. За семь лет сотрудничества, они доказали нам свой профессионализм и надежность.'),
(1295, 64, '_callbacks_list_0_content', 'field_5ea0187f4cb3b'),
(1296, 64, 'callbacks_list_1_name', 'Николай'),
(1297, 64, '_callbacks_list_1_name', 'field_5ea0184f4cb39'),
