(1334, 220, 'callbacks_list_0_content', '<!--(figmeta)eyJmaWxlS2V5IjoiNnhBdnVoaWxKR1lWMHdQNG1xMURPbyIsInBhc3RlSUQiOjIwMTAyODY5NzMsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)--><!--(figma)(/figma)-->В нашем автопарке более 15 грузовых авто, каждое из которых должно быть на ходу, поэтому выбор СТО для нас важен. Техпроект са нам попался после сотрудничества с тремя другими автосервисами. И проведя здесь свое первое ТО семь лет назад, поняли, что больше можно не искать. Из достоинств сервиса отмечу удобное расположение, принимают оплату безнал, не гнут цену, а качество обслуживания хорошее, ремонтируют все по-честному. Работают ребята без выходных, и в любой момент у них можно решить вопросы по ремонту.\r\n\r\nСейчас, как у постоянных клиентов, у нас есть скидка на ремонт, поэтому автосервис БелТракЦентр са не променяем на любой другой. За семь лет сотрудничества, они доказали нам свой профессионализм и надежность.'),
