(273, 1, '2020-04-23 03:07:39', '2020-04-23 00:07:39', '<!--(figmeta)eyJmaWxlS2V5IjoiNnhBdnVoaWxKR1lWMHdQNG1xMURPbyIsInBhc3RlSUQiOjE1MTQ4OTY4NzEsImRhdGFUeXBlIjoic2NlbmUifQo=(/figmeta)--><!--(figma)(/figma)-->В начале 2020 года наша компания прошла сертификацию и начала устанавливать системы бортового взвешивания.\nАвтоперевозчики и транспортные компании всеми силами пытаюсь сократить издержки при транспортировке грузов и уменьшить количество рейсов. Как следствие сами того не желая у них часто возникают ситуации когда грузовик перегружен. Как следствие при проверке на весовом контроле они вынуждены платить огромные штрафы. Кроме того перегрузка транспортного средства ведёт к более быстрому износу узлов и агрегатов и способствует более быстрому разрушению дорожного покрытия.\n\nВ связи с участившимися случаями перегрузки транспортных средств наших партнёров нами была начата установка системы бортового взвешивания от компании NetTruck. Система позволяет решать такую задачу как мгновенный сбор и обработку информации от датчиков контроля веса. В результате чего водитель и собственник ТС может контролировать осевую нагрузку и измерять общую массу автопоезда.', 'Установка систем бортового взвешивания от nettruck', '', 'inherit', 'closed', 'closed', '', '272-revision-v1', '', '', '2020-04-23 03:07:39', '2020-04-23 00:07:39', '', 272, 'http://bts.loc/stati/272-revision-v1/', 0, 'revision', '', 0),
(274, 1, '2020-04-23 03:08:06', '2020-04-23 00:08:06', 'В начале 2020 года наша компания прошла сертификацию и начала устанавливать системы бортового взвешивания.\r\nАвтоперевозчики и транспортные компании всеми силами пытаюсь сократить издержки при транспортировке грузов и уменьшить количество рейсов. Как следствие сами того не желая у них часто возникают ситуации когда грузовик перегружен. Как следствие при проверке на весовом контроле они вынуждены платить огромные штрафы. Кроме того перегрузка транспортного средства ведёт к более быстрому износу узлов и агрегатов и способствует более быстрому разрушению дорожного покрытия.\r\n\r\nВ связи с участившимися случаями перегрузки транспортных средств наших партнёров нами была начата установка системы бортового взвешивания от компании NetTruck. Система позволяет решать такую задачу как мгновенный сбор и обработку информации от датчиков контроля веса. В результате чего водитель и собственник ТС может контролировать осевую нагрузку и измерять общую массу автопоезда.', 'Установка систем бортового взвешивания от nettruck', '', 'publish', 'open', 'open', '', 'ustanovka-sistem-bortovogo-vzveshivanija-ot-nettruck', '', '', '2020-04-23 03:08:06', '2020-04-23 00:08:06', '', 0, 'http://bts.loc/?p=274', 0, 'post', '', 0),
(275, 1, '2020-04-23 03:08:06', '2020-04-23 00:08:06', 'В начале 2020 года наша компания прошла сертификацию и начала устанавливать системы бортового взвешивания.\r\nАвтоперевозчики и транспортные компании всеми силами пытаюсь сократить издержки при транспортировке грузов и уменьшить количество рейсов. Как следствие сами того не желая у них часто возникают ситуации когда грузовик перегружен. Как следствие при проверке на весовом контроле они вынуждены платить огромные штрафы. Кроме того перегрузка транспортного средства ведёт к более быстрому износу узлов и агрегатов и способствует более быстрому разрушению дорожного покрытия.\r\n\r\nВ связи с участившимися случаями перегрузки транспортных средств наших партнёров нами была начата установка системы бортового взвешивания от компании NetTruck. Система позволяет решать такую задачу как мгновенный сбор и обработку информации от датчиков контроля веса. В результате чего водитель и собственник ТС может контролировать осевую нагрузку и измерять общую массу автопоезда.', 'Установка систем бортового взвешивания от nettruck', '', 'inherit', 'closed', 'closed', '', '274-revision-v1', '', '', '2020-04-23 03:08:06', '2020-04-23 00:08:06', '', 274, 'http://bts.loc/stati/274-revision-v1/', 0, 'revision', '', 0),
(276, 1, '2020-04-23 03:08:13', '2020-04-23 00:08:13', 'Кузовоной ремонт грузовых автомобилей одна из самых востребованных услуг нашего грузового СТО. Мы выполняем кузовной ремонт грузовых автомобилей на протяжении многих лет. Популярность кузовного ремонта грузовых авто объясняется неизбежностью повреждений кузова грузовика при эксплуатации. Коррозия кузова, сколы, царапины, повреждения при ДТП - все эти дефекты требуют своевременного устранения.\r\n\r\nНаши специалисты профессионально выполнят кузовной ремонт грузовых автомобилей. Обращаясь к нам для кузовного ремонта грузовика, Вы получите отличный результат по низкой цене. Оперативная работа нашего СТО исключает длительные простои грузового авто. Мы работаем на современном оборудовании и используем только качественные маериалы. На все выполненные работы по кузовному ремонту грузовиков мы даем гарантию. Наш опыт - это залог качества.\r\n\r\nНаш сервис грузовиков работает без выходных. Стоимость и график работ предварительно согласовываются. Так же возможна предварительная запись, поэтому вы можете выбрать удобное для вас время проведения работ по кузовному ремонту грузового автомобиля.', 'Мы выполняем кузовной ремонт грузовых автомобилей на протяжении многих лет', '', 'publish', 'open', 'open', '', 'ustanovka-sistem', '', '', '2020-04-23 03:09:06', '2020-04-23 00:09:06', '', 0, 'http://bts.loc/stati/ustanovka-sistem-bortovogo-vzveshivanija-ot-nettruck-2/', 0, 'post', '', 0),
(277, 1, '2020-04-23 03:09:06', '2020-04-23 00:09:06', 'Кузовоной ремонт грузовых автомобилей одна из самых востребованных услуг нашего грузового СТО. Мы выполняем кузовной ремонт грузовых автомобилей на протяжении многих лет. Популярность кузовного ремонта грузовых авто объясняется неизбежностью повреждений кузова грузовика при эксплуатации. Коррозия кузова, сколы, царапины, повреждения при ДТП - все эти дефекты требуют своевременного устранения.\r\n\r\nНаши специалисты профессионально выполнят кузовной ремонт грузовых автомобилей. Обращаясь к нам для кузовного ремонта грузовика, Вы получите отличный результат по низкой цене. Оперативная работа нашего СТО исключает длительные простои грузового авто. Мы работаем на современном оборудовании и используем только качественные маериалы. На все выполненные работы по кузовному ремонту грузовиков мы даем гарантию. Наш опыт - это залог качества.\r\n\r\nНаш сервис грузовиков работает без выходных. Стоимость и график работ предварительно согласовываются. Так же возможна предварительная запись, поэтому вы можете выбрать удобное для вас время проведения работ по кузовному ремонту грузового автомобиля.', 'Мы выполняем кузовной ремонт грузовых автомобилей на протяжении многих лет', '', 'inherit', 'closed', 'closed', '', '276-revision-v1', '', '', '2020-04-23 03:09:06', '2020-04-23 00:09:06', '', 276, 'http://bts.loc/stati/276-revision-v1/', 0, 'revision', '', 0),
